    "Fast Acting Flow Control Valve Project",nt"tracking_summary": {ntt"total":
    7,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:46:58.879206",nt"name": "fast-acting-flow-control-valve-project",nt"isopen":
    true,nt"url": null,nt"notes": "High power electric propulsion systems have
    the potential to revolutionize space propulsion due to their extremely high performance.
     This can result in significant propellant savings on space vehicles, allowing
    the overall mass to shrink for launch on a less expensive vehicle or to allow the
    space vehicle to carry more payload at the same weight.  Many of the electrical
    propulsion systems operate in pulse mode, pulsing hundreds or even thousands of
    times per second.  Creating reliable valves that can operate in pulse mode for extremely
    long life and at low power are critical in these applications.rnWASK Engineering
    will develop a normally closed, piezo electric operated valve for application to
    pulsing electrical thrusters.  The benefits of such a valve includes 1) demonstrated
    ability to operate at frequencies from 0 Hz to 4,000 Hz, 2) ability to throttle
    continuously from 0-100&#37; open, 3) extremely fast response, 4) low power usage,
    5) infinitely variable valve operating waveforms, sine wave, square wave, saw tooth,
    custom wave form, etc., 6) no EMI generated, 7) very small size provides options
    when locating valve, 8) demonstrated ability to operate at pressures exceeding 1,000
    psi, and 9) very low part count for reliability.",nt"license_title": "U.S.
